		"full_text": "무형문화재 김금화 선생 별세. 영화 ‘만신’은 김금화의 일생으로 현대사를 서술한 영화입니다. 계집아이로 태어나 유아살해를 간신히 면하고 위안부 소집을 피해 열넷에 시집한 시댁에서 학대를 받으며 신병을 앓다 무당이 되어 겪은 내전과 분단. 배우들의 연기가 훌륭하고 특히 문소리가 대단함 https://t.co/hGh5GotKeP",
