		"text": "안녕? 덕아, 덕돌아 \n\n덕이와 덕돌이는 궁궐의 친구입니다.\n이뻐하는 사람들도 있지만, 또 꺼려하는 분들도 있습니다.\n\n덕이와 덕돌이는 사실 이곳이 집입니다.\n바깥은 온통 도로고 그걸 아는듯 이곳을 벗어나지 않으니깐요.\n\n같이 사는 법이 \n이 친구들에게는 쉬운 일이었으면 좋겠습니다. https://t.co/9rCThmTSfb"
