		"text": "맞지 않는다'거나 '사회성이 떨어진다' 같은 평가를 받게 될까 봐 속마음을 숨긴다. 그러고는 계속 곱씹는 것이다. 곱씹다 보면 결론은 늘 나의 문제로 수렴된다. '내가 오해살 만한 행동을 했을 거야', '그 사람은 그럴 의도가 아니었는데, 내가 예민하게 구는 것은 아닐까?' 하는 식이다."
