		"full_text": "프랑스까지 가서 여성폭행 후 체포, 현지 공연 취소까지 당했던 테너 김재형이 예술의 전당 콘서트홀에서 공연한다고. 공연 주제가 무려 ‘새로움의 시작 Moment’ 좃같은 소리 잘들었고요. 어떻게 이런자를 무대에 올릴 수 있는지 이해가 안가는데 예당쪽에 항의전화나 메일 함께 해주셨음 좋겠어요. https://t.co/8PerWeApkl",
