		"text": "그는 글을 잘쓰고 모두가 믿어 의심치 않는 페미니즘, 노동과 인권운동, 진보 지식인으로 글을 쓰죠. 저도 좋은 글에 믿었고 그가 올리는 책의 제목이 궁금하여 물어보는 계기로 친해졌습니다. 그와 멘션을 주고 받다가 애인이 있냐는 질문에 애인이 없는지 오래라 자기는 외로운 사람이라 했죠 https://t.co/qpdYUZyboE"
